import React from "react";
import Header from "../../section/header";
import { useStyles } from "./style";



const Login = (props)=>{

  const s = useStyles()

  return(
    <div>
      <Header/>
      <div className={s.login}>
      <form className="form">
          <CustomIn
            labelText="Email"
            id="email"
            formControlProps={{
              fullWidth: true
            }}
            handleChange={this.handleChange}
            type="text"
          />
          <CustomInput
            labelText="Password"
            id="password"
            formControlProps={{
              fullWidth: true
            }}
            handleChange={this.handleChange}
            type="password"
          />

          <Button type="button" color="primary" className="form__custom-button">
            Log in
          </Button>
        </form>
      </div>
    </div>
  )
}

export default Login
